var HTMLOption='<option value="%value%">%text%</option>';var options={search:{cities:[{value:"santa fe",text:"Santa Fe",km:false},{value:"santo tome",text:"Santo Tomé",km:false},{value:"la guardia",text:"La Guardia",km:true},{value:"colastine",text:"Colastiné",km:true},{value:"rincon",text:"Rincón",km:true},{value:"arroyo leyes",text:"Arroyo Leyes",km:true},],tipoProp:[{value:"casa",text:"Casa"},{value:"departamento",text:"Departamento"},{value:"terreno",text:"Terreno"},{value:"cochera",text:"Cochera"},{value:"galpon",text:"Galpón"},{value:"local",text:"Local"},{value:"oficina",text:"Oficina"},{value:"quinta",text:"Quinta"},],},};options.search.appendCities=function(){$ciudad=$("#ciudad");this.cities.forEach(function(b){var a=HTMLOption.replace("%value%",b.value).replace("%text%",b.text);$ciudad.append(a)})};options.search.appendTipoProp=function(){$tipoProp=$("#tipoProp");this.tipoProp.forEach(function(b){var a=HTMLOption.replace("%value%",b.value).replace("%text%",b.text);$tipoProp.append(a)})};